import React from 'react'
import './Home.css';

function Home() {
return(

    <div className='home-container'>
        <h1 className='home-title'>Home </h1>
        <ul>
            <li><a href="http://localhost:3000/login">Login</a></li>
            <li><a href="http://localhost:3000/register">Register</a></li>
        </ul>
    </div>

);

}

export default Home;
